import React, { Component } from 'react'
import Tabs from './Tabs'

class ProfileTabs extends Component {
  constructor() {
    super()
    this.state = {
      tabs: ['Bio', 'Followers', 'Art Works', 'Collections' ]
    }
  }

  render() {
    return(
      <div className="tabs">
          {
            this.state.tabs.map((item, index) => {
              return(
                <div key={index}>
                    <Tabs item={item} />
                </div>
              )
            })
          }
      </div>
    )
  }
}

export default ProfileTabs
